package Pattern;

public class Pattern_9029 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		
		for(int i=0;i<5;i++)
		{
			char ch='E';
			for(int j=0;j<5;j++)
			{
				System.out.print(ch+" ");
				ch--;
			}
			System.out.println();
		}

	}

}
